import people from '../assets/images/image 1.png';

const WaitingList = () => {
    return (
        <section className="aplication mt-[-80px] relative">
            <div className="w-full flex flex-wrap justify-between gap-y-[80px]">
                <div className="w-1/2">
                    <h2 className="text-[32px] font-bold color-natural mb-8">Fity predstavlja spoj nutricionizma, kulinarstva i tehnologije</h2>
                    <p>Svi alati za planiranje, pripremu i praćenje plana ishrane su sigurni, bezbedni i zdravi.</p>
                    <p>Aplikacija je kreirana od strane stručnih lica, među kojima su eminentni nutricionisti, fitnes zajednica, psiholozi, IT stručnjaci i kulinarski majstori.</p>
                </div>
                <div className="w-1/2 pr-[40px] mt-auto mb-auto">
                    <img src={people} alt="people" />
                </div>
            </div>

        </section>
    );
};

export default WaitingList;
